script: |
  super -f text -I q1296.spq | sort > q1296.out

inputs:
  - name: q1296.spq
    data: |
      SELECT ALL - tab1.col2 * - col1 * + col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT ( - col1 - + col0 ) BETWEEN + col0 + + col1 AND NULL;
  - name: tab1

outputs:
  - name: q1296.out
    data: |
      36480
      4212
      99840
